import React, { useEffect } from 'react'
import './home.css'
import { useState } from 'react'
const Home = () => {
    const [data,setData]=useState([])
    const [error,setError]=useState("")
    useEffect(()=>{
        fetch("./json.json ")
.then(response=>response.json())
.then(json=>setData(json))
.catch(error=>setError("failed to load data"))
    },[])
    return (
        <div className='he'>
            <div className='head'>
                <img src="./asset/Group (1).png" alt="pic" className='mb' />
              
                <span className='war'>Deliver To</span>
                <img src="./asset/Group (2).png" alt="pi" className='mbd'/>
            </div>
            <div>
                <h4>What Would you Like</h4><br></br>
                <h4>to Order</h4>
            </div>
            <div>
                <input className="asd" type="text" placeholder='find for food or restaurnent'/>
            </div>
            {data.map((val,index)=>(
                     <div key={index}>
                             <img src={val.image} alt="" />
                            {val.name}
                     </div>
            ))}
        </div>
    )
}

export default Home
